// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract SimpleContract {
  enum ItemStatus {
        active,
        sold,
        removed
    }

    struct Item {
        bytes32 name;
        uint price;
        address seller;
        ItemStatus status;
    }

    event ItemAdded(bytes32 name, uint price, address seller);
    event ItemPurchased(uint itemID, address buyer, address seller);
    event ItemRemoved(uint itemID);
    event FundsPulled(address owner, uint amount);

    Item[] private _items;
    mapping (address => uint) public _pendingWithdrawals;

    modifier onlyIfItemExists(uint itemID) {
        require(_items[itemID].seller != address(0));
        _;
    }

    function addNewItem(bytes32 name, uint price) public returns (uint) {

          _items.push(Item({
            name: name,
            price: price,
            seller: msg.sender,
            status: ItemStatus.active
        }));

        // Item is pushed to the end, so the lenth is used for
        // the ID of the item
		emit ItemAdded(name, price, msg.sender);
        return _items.length;
    }

  struct asset {
        bytes32 asset_id;
        string[] asset_capabilities;
        address owner;
    }

    struct request {
        bytes32 rfq_id;
        string[] rfq_capabilities;
        //address rfq_owner;
        bool isSet;

    }

    struct bid{
        uint bid_id;
        bytes32 bidasset_id;
        bytes32 request_id;
    }


    bid[]   bids_array;
    mapping (address => asset) asset_map;
    mapping (bytes32 => request) public requests;
    mapping (bytes32 => asset) public assets;
    mapping (uint => bid) public bids;

    mapping (uint => asset) public bid_asset_map;
    mapping (bytes32 => uint) public bid_rfq_map;
    uint public asset_count;
    uint public bid_count;
    uint public request_count;

    constructor() public{
        asset_count = 0;
        request_count = 0;
        bid_count = 0;
    }


    function createasset(bytes32 asset_id, string[] memory asset_capabilities) public {
        address owner = msg.sender;

        assets[asset_id] = asset(asset_id, asset_capabilities, owner);

        asset_count++;

    }

    function createrfq(bytes32 rfq_id, string[] memory rfq_capabilities) public {
        requests[rfq_id] = request(rfq_id, rfq_capabilities, true);
        //all_requests.push(rfq_id);
		//emit ItemAdded(rfq_id, rfq_capabilities);
        request_count++;
        //console.log("RFQ is created");
    }
    function allRfQ() public returns(uint){
      return request_count;
    }
    function createbid(bytes32 bidasset_id, bytes32 request_id) public payable {
        if (!requests[request_id].isSet) {
            revert("Request does not exist.");
        }

        uint flag = 0;
        bytes32 bid_asset_temp;

        for (uint i = 0; i < requests[request_id].rfq_capabilities.length; i++) {
            for (uint j = 0; j < assets[bidasset_id].asset_capabilities.length; j++) {
                if (compareStrings(requests[request_id].rfq_capabilities[i], assets[bidasset_id].asset_capabilities[j])) {
                    flag++;
                    bid_asset_temp = bidasset_id;
                }
            }
        }

        if (flag >= requests[request_id].rfq_capabilities.length){
            bids[bid_count] = bid(bid_count, bidasset_id, request_id);
            bid_count++;
            bid memory m;
            m.bid_id = bid_count;
            m.bidasset_id = bidasset_id;
            m.request_id = request_id;
            bids_array.push(m);
            //bid_asset_map[bid_id] = assets[bid_asset_temp];
            bid_asset_map[bid_count] = asset(bid_asset_temp,assets[bid_asset_temp].asset_capabilities,msg.sender);
            bid_rfq_map[request_id] = bid_count;//asset(bid_asset_temp,assets[bid_asset_temp].asset_capabilities,msg.sender);
            //console.log("Bids: ", bid_asset_map[bid_count].asset_capabilities.length);
        }

    }

    function compareStrings(string memory a, string memory b) public view returns (bool) {
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))));
    }




    function getAllBidsAssets() public view returns(asset[] memory) {
        asset[] memory a_array = new asset[](bid_count);
        for (uint i = 0; i < bid_count; i++) {
       //     asset storage _oneasset = bid_asset_map[0];
        //    a_array[i] = assets_array[];
        }
        return (a_array);
    }


    function getAllBids() public view returns(asset[] memory) {

        //bid[] memory b_array = new bid[](bid_count);
        asset[] memory a_array = new asset[](bid_count);
        for (uint i = 0; i < bids_array.length; i++) {

            a_array[i] = bid_asset_map[bids_array[i].bid_id];
        //    bid storage _onebid = bids[i]; // mapping (uint => bid) bids
        //    b_array[i] = _onebid;
            //asset storage _oneasset = assets[i];
            //a_array[i] = _oneasset;
        }
        return (a_array);
    }


    function getAllBidsForRFQ(bytes32 request_id) public view returns (asset memory) {
         return bid_asset_map[bid_rfq_map[request_id]];//bid_rfq_map[request_id];
        // asset[] memory a_array ;//= new asset[](bid_count);
        // uint index = 0;
        // for (uint i = 0; i < bids_array.length; i++) {
        //    if(bids_array[i].request_id == request_id)
        //     {
        //         a_array[index] = bid_asset_map[bids_array[i].bid_id];
        //         index++;
        //     }
        // }
        // return (a_array);
    }




    function getassetOwnership(bytes32 asset_id) public view returns (address owner){
        return assets[asset_id].owner;


    }




    function tranferasset(address new_owner, bytes32 asset_id) public payable {
        assets[asset_id].owner = new_owner;

    }
}
